import React from "react";
import TournamentForm from "../components/Form/form";

function Home() {
  return (
    <div className="container-fluid">
      <div className="row">
        <div className="col-lg-3 col-md-3 col-sm-1"></div>
        <button type="button">Existing tournament</button>
        <div className="col-lg-6 col-md-6 col-sm-10">
          <TournamentForm />
        </div>
        <div className="col-lg-3 col-md-3 col-sm-1"></div>
      </div>
    </div>
  );
}

export default Home;
